    if (uniffi_yttrium_checksum_func_funding_metadata_to_amount() != 52092) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_yttrium_checksum_func_funding_metadata_to_bridging_fee_amount() != 38273) {
        return InitializationResult.apiChecksumMismatch
